import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import Routes
import { ApolloProvider } from '@apollo/client';

import Home from './web/view/Home';
import { SignIn } from './web/view/SignIn.js';
import { SignUp } from './web/view/SignUp.js';
import { QuestionPage } from './web/view/Question.js';
import { NewQuestion } from './web/view/newQuestion.js';
import { Profile } from './web/view/Profile.js';
import { client } from './apollo.js';

import './App.css';

function App() {
  return (
    <ApolloProvider client={client}> {
      /* Wrap your app with ApolloProvider */
    }
      <Router>
        <Routes>
          
          <Route path="/" element={<Home />} />
          <Route path="/signin" element={<SignIn />} />
          <Route path="/signup" element={<SignUp />} />

          <Route path="/profile" element={<Profile />} />
          <Route path="/question/:id" element={<QuestionPage />} /> {/* Use the correct path pattern with a dynamic 'id' parameter */}
          <Route path="/newquestion" element={<NewQuestion />} />

        </Routes>
      </Router>
    </ApolloProvider>
  );
}

export default App;
